import "./App.css";
import React from "react";

const courses = [
  {
    name: 'Full Stack Developement Program',
    price: '89,999'
  },
  {
    name: 'Python Automation Testing Program',
    price: '64,999'
  },
  {
    name: 'UI/UX Program',
    price: '89,999'
  }
]

function App(props) {

  const arrayDataItems = courses.map(course =>
    <li>{course}</li>
  );

  return (
    <div className="container">
      <ul>{arrayDataItems}</ul>
    </div>
  );
}

export default App;
